 import "../assets/image"
const Home = () => {


  return (

    <div>
      <Navbar/>
      <div class="main-content">
      <div className="App">
      <CustomSlider>
        {images.map((image, index) => {
          return <img key={index} src={image.imgURL} alt={image.imgAlt} />;
        })}
      </CustomSlider>
      </div>
      </div>



    </div>
  );
};

export default Home;
